import React, { Component } from 'react';
import Header from './Header';
import Form from './Form';
import Roles from './Roles';
import Associated from './Associated';
import RoleData from './user_roles.json'
import './../App.css';

class App extends Component {

  state = {
    items: []
  } 

  usersId = 0

  componentDidMount() {
      this.setState({
        items: RoleData
      }); 
      console.log(RoleData);
  }

  render() {

     return (
        <div>
          <Header />
          <Form />
          {this.state.items.map((item, i) => {
              return (
                <div> 
                  <Roles 
                    key={item.id}
                    name={item.name}
                    type={item.type}
                    description={item.description}
                    postdate={item.modified_on}
                  /> 

                  <Associated 
                    altID={item.users[i].first_name}
                    photo_url={item.users[i].photo_url}
                  />
              </div>
              ) 
            })
            }
        </div>
      );
  }
}

export default App;
